import React from 'react'
import "./Check.css"
const Check = () => {
  return (
    <div className='check'>
        <div className='outfits'>
            <img src='https://images.unsplash.com/flagged/photo-1570733117311-d990c3816c47?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MjJ8fGZhc2hpb258ZW58MHwwfDB8fHww' alt='outfits'/>
        </div>
    </div>
  )
}

export default Check
